settings.cellStyleFunction:
if (value.includes("ACTIVE")) { //ACTIVE_UNACK, ACTIVE_ACK
    return {
        color: 'red'
    };
} 
else if (value === "CLEARED_UNACK") {
    return {
        color: 'orange'
    };
}
else {
    return {
        color: 'green'
    };
}

settings.cellContentFunction:
if (alarm.status.includes("ACTIVE")) {
    var elapsed = (Date.now() - value) / 1000;
    var hours = Math.floor(elapsed / 3600);
    var mins = Math.floor((elapsed / 60) - (hours * 60));
    var days = Math.floor(hours / 24);
    hours = hours - (days * 24);
    if (days === 0 && hours === 0 && mins < 60) {
        var secs = Math.floor(elapsed) - (mins * 60);
        return (mins + " min " + secs + " sec");
    } else {
        return (days + " day " + hours +
            " hr " + mins + " min");
    }

} else {
    var elapsed = (alarm.clearTs - alarm.startTs) / 1000;
    var hours = Math.floor(elapsed / 3600);
    var mins = Math.floor((elapsed / 60) - (hours * 60));
    var days = Math.floor(hours / 24);
    hours = hours - (days * 24);
    if (days === 0 && hours === 0 && mins < 60) {
        var secs = Math.floor(elapsed) - (mins * 60);
        return (mins + " min " + secs + " sec");
    } else {
        return (days + " day " + hours +
            " hr " + mins + " min");
    }

}

if (alarm.status.includes("ACTIVE")) {
    return "-";
} else {
    const format = "YYYY-MM-DD HH:mm:ss";
    return moment(value).format(format);
}

settings.colorFunction:
var type = dsData[dsIndex]['type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', amount = percent).toHexString();
	}
	return 'blue';
}

settings.markerImageFunction:
var type = dsData[dsIndex]['type'];
if (type == 'thermomether') {
	var res = {
	    url: images[0],
	    size: 40
	}
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120;
	    var index = Math.min(3, Math.floor(4 * percent));
	    res.url = images[index];
	}
	return res;
}

settings.tooltipFunction:
var deviceType = dsData[dsIndex]['deviceType'];
if (typeof deviceType !== undefined) {
    if (deviceType == "energy meter") {
        return '<b>${entityName}</b><br/><b>Energy:</b> ${energy:2} kWt<br/>';
    } else if (deviceType == "thermometer") {
        return '<b>${entityName}</b><br/><b>Temperature:</b> ${temperature:2} °C<br/>';
    }
}

settings.labelFunction:
